    inputTrailingTriggerKeyTimeout: "\u0623\u062F\u062E\u0644 \u0627\u0644\u0641\u0627\u0635\u0644 \u0627\u0644\u0632\u0645\u0646\u064A \u0628\u064A\u0646 \u0627\u0644\u0645\u0634\u063A\u0644\u0627\u062A \u0644\u0625\u0646\u0647\u0627\u0621 \u0627\u0644\u062A\u062D\u0631\u064A\u0631 \u0648\u0627\u0644\u0633\u0631\u062F.",
