    "subtitle.humanSubtitlesPreferredDescription": "\u0639\u0646\u062F\u0645\u0627 \u064A\u062D\u062A\u0648\u064A \u0645\u0642\u0637\u0639 \u0641\u064A\u062F\u064A\u0648 \u0639\u0644\u0649 \u062A\u0631\u062C\u0645\u0627\u062A \u064A\u062F\u0648\u064A\u0629 \u0628\u0627\u0644\u0644\u063A\u0629 \u0627\u0644\u0647\u062F\u0641\u060C \u0627\u0633\u062A\u062E\u062F\u0645 \u0627\u0644\u062A\u0631\u062C\u0645\u0627\u062A \u0627\u0644\u064A\u062F\u0648\u064A\u0629 \u0623\u0648\u0644\u0627\u064B (\u0645\u0648\u0635\u0649 \u0628\u0647)",
