    "error.serveUnavailable": "\u0627\u0644\u062E\u062F\u0645\u0629 [{serverName}] \u0627\u0644\u062A\u064A \u062A\u0633\u062A\u062E\u062F\u0645\u0647\u0627 \u062D\u0627\u0644\u064A\u064B\u0627 \u063A\u064A\u0631 \u0642\u0627\u0628\u0644\u0629 \u0644\u0644\u0648\u0635\u0648\u0644 \u0645\u0624\u0642\u062A\u064B\u0627 \u0628\u0633\u0628\u0628 \u0645\u0634\u0643\u0644\u0629 \u0641\u064A \u0627\u0644\u0627\u062A\u0635\u0627\u0644 \u0628\u0627\u0644\u0634\u0628\u0643\u0629 \u0623\u0648 \u0645\u0632\u0648\u062F \u0627\u0644\u062E\u062F\u0645\u0629. \u0646\u0642\u062A\u0631\u062D \u0639\u0644\u064A\u0643 \u062A\u062D\u062F\u064A\u062B \u0627\u0644\u0635\u0641\u062D\u0629 \u0623\u0648 \u062A\u063A\u064A\u064A\u0631 \u062E\u062F\u0645\u0629 \u0627\u0644\u062A\u0631\u062C\u0645\u0629 \u0627\u0644\u0623\u062E\u0631\u0649 \u0645\u0646 \u062E\u0644\u0627\u0644 <1>\u0627\u0644\u0625\u0639\u062F\u0627\u062F\u0627\u062A</1>. \u0625\u0630\u0627 \u0643\u0646\u062A \u0639\u0636\u0648\u064B\u0627 \u0641\u064A <2>Pro</2>\u060C \u064A\u0645\u0643\u0646\u0643 \u0627\u062E\u062A\u064A\u0627\u0631 \u0627\u0633\u062A\u062E\u062F\u0627\u0645 \u062E\u062F\u0645\u0629 \u0627\u0644\u062A\u0631\u062C\u0645\u0629 DeepL \u0623\u0648 OpenAI \u0627\u0644\u0623\u0643\u062B\u0631 \u0627\u0633\u062A\u0642\u0631\u0627\u0631\u064B\u0627 (<3>\u0627\u0646\u0642\u0631 \u0647\u0646\u0627 \u0644\u062A\u062C\u0631\u0628\u0629 \u0645\u062C\u0627\u0646\u064A\u0629</3>). \u0628\u0627\u0644\u0625\u0636\u0627\u0641\u0629 \u0625\u0644\u0649 \u0630\u0644\u0643\u060C \u0642\u062F \u062A\u062D\u062A\u0627\u062C \u0623\u064A\u0636\u064B\u0627 \u0625\u0644\u0649 \u0627\u0644\u062A\u062D\u0642\u0642 \u0645\u0646 \u0625\u0639\u062F\u0627\u062F\u0627\u062A \u0627\u0644\u0634\u0628\u0643\u0629 \u0623\u0648 \u0627\u0644\u0648\u0643\u064A\u0644 \u0627\u0644\u062E\u0627\u0635\u0629 \u0628\u0643.",
