    changeToOnlyTempTranslationMode: "\u0642\u0645 \u0628\u0627\u0644\u062A\u0628\u062F\u064A\u0644 \u0625\u0644\u0649 \u0625\u0638\u0647\u0627\u0631 \u0627\u0644\u062A\u0631\u062C\u0645\u0627\u062A \u0641\u0642\u0637",
    changeToDualTempTranslationMode: "\u0627\u0644\u062A\u0628\u062F\u064A\u0644 \u0625\u0644\u0649 \u0627\u0644\u062A\u0631\u062C\u0645\u0629 \u062B\u0646\u0627\u0626\u064A\u0629 \u0627\u0644\u0644\u063A\u0629",
    "transitionMode.translation": "\u0641\u0642\u0637 \u0627\u0644\u0646\u0635 \u0627\u0644\u0645\u062A\u0631\u062C\u0645",
    "options.navbar.translateFile": "\u062A\u0631\u062C\u0645\u0629 \u0627\u0644\u0648\u062B\u0627\u0626\u0642",
    "transitionMode.dual": "\u0645\u0642\u0627\u0628\u0644\u0629 \u062B\u0646\u0627\u0626\u064A\u0629 \u0627\u0644\u0644\u063A\u0629",
    "options.navbar.installApp": "\u062A\u062B\u0628\u064A\u062A \u062A\u0637\u0628\u064A\u0642 \u0627\u0644\u0647\u0627\u062A\u0641 \u0627\u0644\u0645\u062D\u0645\u0648\u0644",
    "transitionMode.inherit": "\u0645\u0639 \u0627\u0644\u062D\u0641\u0627\u0638 \u0639\u0644\u0649 \u0627\u0644\u062A\u0646\u0627\u0633\u0642 \u0645\u0639 \u0648\u0636\u0639 \u0639\u0631\u0636 \u0627\u0644\u062A\u0631\u062C\u0645\u0629 \u0627\u0644\u0627\u0641\u062A\u0631\u0627\u0636\u064A \u0644\u0644\u0646\u0638\u0627\u0645",
    "subtitle.transitionMode": "\u0625\u0639\u062F\u0627\u062F\u0627\u062A \u0627\u0644\u062A\u0631\u062C\u0645\u0629 \u0641\u0642\u0637 / \u0627\u0644\u062A\u0631\u062C\u0645\u0629 \u0627\u0644\u062B\u0646\u0627\u0626\u064A\u0629 \u0644\u0644\u062A\u0631\u062C\u0645\u0629 \u0627\u0644\u0641\u064A\u062F\u064A\u0648",
    "subtitle.transitionModeDescription": "\u0642\u0645 \u0628\u062A\u0639\u064A\u064A\u0646 \u062A\u0631\u062C\u0645\u0629 \u0627\u0644\u0641\u064A\u062F\u064A\u0648 \u0625\u0644\u0649 \u0627\u0644\u0646\u0635 \u0627\u0644\u0645\u062A\u0631\u062C\u0645 \u0641\u0642\u0637 \u0623\u0648 \u0645\u0642\u0627\u0631\u0646\u0629 \u0627\u0644\u0644\u063A\u062A\u064A\u0646",
